import React, { Component } from "react";
class Head extends Component {
  state = {
    logo:
      "https://raw.githubusercontent.com/mdn/learning-area/master/html/multimedia-and-embedding/mdn-splash-page-start/originals/firefox-addons.jpg"
  };
  render() {
    return (
      <div>
        <h1>Mozilla</h1>
        <img src={this.state.logo} alt="" style="{float: right}" />;
      </div>
    );
  }
}

export default Head;
